// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract CrowdfundFlexible is ReentrancyGuard {

    struct Campaign {
        address payable creator;
        uint256 goalWei;
        uint256 pledgedWei;
        uint64 deadline;
        bool withdrawn;
    }

    uint256 public campaignCount;
    mapping(uint256 => Campaign) public campaigns;
    mapping(uint256 => mapping(address => uint256)) public pledged;

    event CampaignCreated(uint256 id, address creator, uint256 goalWei, uint64 deadline);
    event Pledged(uint256 id, address pledger, uint256 amount);
    event Withdrawn(uint256 id, address creator, uint256 amount);
    event Refunded(uint256 id, address pledger, uint256 amount);

    function createCampaign(uint256 goalWei, uint64 durationSeconds) external returns (uint256) {
        require(goalWei > 0, "goal > 0");
        require(durationSeconds > 0, "duration > 0");

        campaignCount++;
        uint64 deadline = uint64(block.timestamp + durationSeconds);

        campaigns[campaignCount] = Campaign({
            creator: payable(msg.sender),
            goalWei: goalWei,
            pledgedWei: 0,
            deadline: deadline,
            withdrawn: false
        });

        emit CampaignCreated(campaignCount, msg.sender, goalWei, deadline);
        return campaignCount;
    }

    function pledge(uint256 id) external payable nonReentrant {
        Campaign storage c = campaigns[id];
        require(block.timestamp <= c.deadline, "ended");
        require(msg.value > 0, "no ETH");

        pledged[id][msg.sender] += msg.value;
        c.pledgedWei += msg.value;

        emit Pledged(id, msg.sender, msg.value);
    }

    function withdraw(uint256 id) external nonReentrant {
        Campaign storage c = campaigns[id];
        require(msg.sender == c.creator, "not creator");
        require(block.timestamp > c.deadline, "not ended");
        require(!c.withdrawn, "withdrawn");

        uint256 amount = c.pledgedWei;
        c.withdrawn = true;
        c.pledgedWei = 0;

        (bool ok, ) = c.creator.call{value: amount}("");
        require(ok, "transfer failed");

        emit Withdrawn(id, c.creator, amount);
    }

    function refund(uint256 id) external nonReentrant {
        Campaign storage c = campaigns[id];
        require(block.timestamp > c.deadline, "not ended");
        require(!c.withdrawn, "creator withdrew");

        uint256 bal = pledged[id][msg.sender];
        require(bal > 0, "no pledge");

        pledged[id][msg.sender] = 0;
        (bool ok, ) = payable(msg.sender).call{value: bal}("");
        require(ok, "refund failed");

        emit Refunded(id, msg.sender, bal);
    }
}

